import React from 'react';

import Button from '../Button/Button';
import './Modal.scss';

const Modal = ({closeModal}) => (

    <div className="overlay">
        <div className="modal-content">
            <p>Modal</p>
            <Button
                className="btn" 
                onClick={closeModal}
            >
                Close
            </Button>
        </div>
    </div>

);


export default Modal;
